import React from "react";
import arrowLeft from "./images/icon-prev.svg";
import arrowRight from "./images/icon-next.svg";
import Testimonialone from "./Testimonialone";
import Testimonialtwo from "./Testimonialtwo";


function Avatar(){


   return <div>
   <div class="avatar">
   <div class="slide_1">
       
        <img src={require("./images/image-john.jpg")} alt="Avatar" />
   </div>
    <div class="slide_2">
        
        <img src={require("./images/image-tanya.jpg")} alt="Tanya's Picture" />
    </div>
    <div className="slider_btn">
      <button className="slider__btn slider__previous">
        <img src={arrowLeft} alt="previous-slide" />
      </button>
      <button className="slider__btn slider__next">
        <img src={arrowRight} alt="next-slide" />
      </button>
    </div>

   
    </div>

    
    </div>

}

export default Avatar;
